-- Table structure for `auction`
-- ----------------------------
DROP TABLE IF EXISTS `auction`;
CREATE TABLE `auction` (
  `id` int(11) NOT NULL auto_increment,
  `type` int(11) NOT NULL COMMENT '0 - 寄售金币，1 - 寄售物品',
  `seller` int(11) NOT NULL COMMENT '出售者ID',
  `requiremoney` int(11) NOT NULL COMMENT '出售的价格',
  `requiregold` int(11) NOT NULL,
  `money` int(11) NOT NULL,
  `item` blob NOT NULL,
  `createtime` datetime NOT NULL,
  PRIMARY KEY  (`id`),
  KEY `type` (`type`),
  KEY `id` (`id`),
  KEY `seller` USING BTREE (`seller`)
) ENGINE=MyISAM AUTO_INCREMENT=186 DEFAULT CHARSET=utf8;

